function showSdt() {
    var id = $('#khuvuc').val();
    $.ajax({
        url: _link + 'ajax/',
        method: 'post',
        dataType: 'html',
        crossDomain: true,
        data: {
            method: 'getSdt',
            id: id
        },
        success: function(res) {
            console.log(res);
            $('#dienthoai').val(res);
        }
    });
}
function buyPayPal() {
    swal({
            title: "",
            text: "Bạn sẽ được chuyển qua trang PAYPAL để hoàn tất thanh toán, vui lòng không đóng trình duyệt sau khi hoàn thành giao dịch.",
            icon: "warning",
            buttons: true,
            dangerMode: true,
        })
        .then((willDelete) => {
            if (willDelete) {
                var soLuong = $('#slspct').val();
                if (Math.floor(soLuong) == soLuong && $.isNumeric(soLuong)) {
                    soLuong = soLuong;
                } else {
                    soLuong = 1;
                }
                $.ajax({
                    url: _link + 'ajax/',
                    method: 'post',
                    dataType: 'json',
                    crossDomain: true,
                    data: {
                        method: 'paypal_payment'
                    },
                    success: function(res) {
                        if ($("#ppFrm") != null) {
                            var form = $("#ppFrm");
                            form.attr('action', res.action);
                            form.attr('method', 'post');
                            // form.html(res.dataform);
                            form.submit();
                        }
                    }
                });
            }
        });

}
$(function() {
    $('#checkout').on('submit', function(e) {
        var $this = $(this);
        var phuongthucthanhtoan = $this.find('[name=phuongthucthanhtoan]:checked').val();
        e.preventDefault();
        if (phuongthucthanhtoan == 1) {
            // Lay mang khach hang
            var frmCustomer = $('#checkout'),
                dienthoai = frmCustomer.find('[name=dienthoai]').val(),
                hoten = frmCustomer.find('[name=hoten]').val(),
                email = frmCustomer.find('[name=email]').val(),
                diachi = frmCustomer.find('[name=diachi]').val(),
                ghichu = frmCustomer.find('[name=ghichu]').val();
            if (dienthoai != null) {
                $.ajax({
                    url: _link + 'ajax/',
                    cache: false,
                    type: 'GET',
                    data: {
                        method: 'customer_tmp',
                        dienthoai: dienthoai,
                        hoten: hoten,
                        email: email,
                        diachi: diachi,
                        ghichu: ghichu
                    },
                    success: function(response) {
                        if (response) {
                            buyPayPal();
                        } else {
                            swal('Có lỗi xảy ra, vui lòng thử lại', '', 'error');
                        }
                    }
                });
            } else {
                swal('Vui lòng nhập số điện thoại', 'Số điện thoại cần nhập chính xác để chúng tôi gọi xác nhận đơn hàng.', 'warning');
            }
        } else {
            $this.unbind().submit();
        }
    });
});

