$(function() {

    $('.search-fixed').on('click', function(e) {
        if (e.target !== this)
            return;
        $('.search-fixed').removeClass('opened');
    });

    $('.icon-search').on('click', function() {
        var
            $this = $(this);

        $('.search-fixed').toggleClass('opened');
    });

    $(document).on('click', '#datTourBtn', function() {
        var errors = empty = false;
        var mess = null;
        $("#datTourFrm input").each(function(index, el) {
            // element == this
            var name = $(el).attr('name');
            if (!$(el).val().length) {
                empty = errors = true;
                $(el).focus();
                $(el).parent().addClass('has-error');
            } else {
                $(el).parent().removeClass('has-error');
            }

            if (name == 'sodienthoai' && !empty) {
                if (isNaN($(el).val()) || $(el).val().length < 10) {
                    mess = 'Vui lòng nhập số điện thoại';
                    $(el).parent().addClass('has-error');
                    errors = true;
                } else {
                    $(el).parent().removeClass('has-error');
                }
            } else if (name == 'email' && !empty) {
                if (!isMail($(el).val())) {
                    mess = 'Vui lòng nhập địa chỉ email';
                    $(el).parent().addClass('has-error');
                    errors = true;
                } else {
                    $(el).parent().removeClass('has-error');
                }
            }

        });

        if (!errors && !empty) {
            var data = JSON.stringify(
                $("#datTourFrm input, #datTourFrm textarea").serializeObject()
            );

            $.ajax({
                type: "POST",
                url: _link + "ajax/",
                data: ({
                    value: data,
                    method: 'booktour'
                }),
                dataType: "json",
                success: function(response) {
                    if (response) {
                        var mgs = response.message ? response.message : 'Có lỗi xảy ra, vui lòng thử lại.';
                        var status = response.status ? response.status : 'success';

                        $('#myModal').modal('hide');
                        $('.modal-backdrop').remove();
                        swal(mgs, '', status);
                    }
                }
            });

        } else {
            if (!mess) mess = 'Vui lòng nhập đủ thông tin'
        }

        if (mess) {
            swal(mess, '', 'warning');
        }
    });
});

