function MuaHang(url, div) {
    $.getJSON(url, {
        divReturn: div
    }, function(data) {
        if (data.error != "success") {
            if (data.error == "quantity_unknown") {
                swal("Số lượng không hợp lệ!", "", "error");
                self.location.href = '';
            }
        } else {
            $('#' + div).html(data.result);
            $("#countCart").text(data.quantity);
        }
    });
}
